import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Register from './Register';
import Login from './Login';

class App extends React.Component {
    render() {
        return (
            <div className="App">
                <Router>
                    <Routes>
                        <Route path="/items" element={<Table items={ this.state.items } handleRemoveRow={ this.handleRemoveRow } handleEdit = {this.handleEdit} showLogin = {this.state.showLogin} showLogout={this.state.showLogout}/>  }/>
                    </Routes>

                </Router>

            </div>
        );
    }
}

export default App;
